import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { Typography } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';
// import Login from './homeComponents/loginBtn.js'
// import Create from './homeComponents/createActBtn.js'
// import InputEmail from './homeComponents/inputFormEmail.js'
// import InputPass from './homeComponents/inputFormPass.js'
// import Terms from './homeComponents/terms.js'


const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  demo: {
    height: 200,
  },
  control: {
    padding: theme.spacing.unit * 2,
  },
  dense: {
    marginTop: 16,
    padding: theme.spacing.unit * 10
  },
  root: {
    flexGrow: 1,
  },
  demo: {
    height: 50,
  },
  control: {
    padding: theme.spacing.unit * 2,
  },
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
  },
});


class Home extends Component {

  state = {
    direction: 'column',
    justify: 'center',
    alignItems: 'center',
  }

  handleChange = key => (event, value) => {
    this.setState({
      [key]: value,
    });
  };

  render() {
    const { classes } = this.props;
    const { alignItems, direction, justify } = this.state;

    return (
      <>
        <Grid container justify="center" alignItems="center"> 
          <img src="./images/piggy.jpg" alt='piggy'/>
        </Grid>
        <Grid container justify="center" alignItems="center">
          <Typography variant='h6'>Save More,</Typography>
        </Grid>
        <Grid container justify="center" alignItems="center">
          <Typography variant='h6'>Budgeting Made Easy.</Typography>
        </Grid>
        <form className={classes.container} noValidate autoComplete="off">
        <Grid container justify="center" alignItems="center">
        <TextField
        required
          id="HomeEmail"
          label="Email"
          className={classes.textField}
          type="email"
          name="email"
          autoComplete="email"
          margin="normal"
        />
        <TextField
        required
          id="homePassword"
          label="Password"
          className={classes.textField}
          type="password"
          autoComplete="current-password"
          margin="normal"
        />
        </Grid>
      </form>
        
      </>
    )
  }
}
  Home.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export default withStyles(styles)(Home);

